(self.webpackChunk=self.webpackChunk||[]).push([[8387],{8387:function(n){n.exports='<blockquote> <p>此章节描述 webpack 内部实现，对于插件开发人员可能会提供帮助</p> </blockquote> <p>打包，是指处理某些文件并将其输出为其他文件的能力。</p> <p>但是，在输入和输出之间，还包括有 <a href="concepts/modules/index.htm"/*tpa=https://webpack.docschina.org/concepts/modules/*/>模块</a>, <a href="concepts/entry-points/index.htm"/*tpa=https://webpack.docschina.org/concepts/entry-points/*/>入口起点</a>, chunk, chunk 组和许多其他中间部分。</p> <h2 id="the-main-parts">主要部分 <a href="#the-main-parts" aria-hidden="true" tabindex="-1"><span class="header-link"></span></a></h2> <p>项目中使用的每个文件都是一个 <a href="concepts/modules/index.htm"/*tpa=https://webpack.docschina.org/concepts/modules/*/>模块</a></p> <p><strong>./index.js</strong></p> <pre><code class="hljs language-js"><span class="token keyword">import</span> app <span class="token keyword">from</span> <span class="token string">\'app.js\'/*tpa=https://webpack.docschina.org/app.js*/</span><span class="token punctuation">;</span></code></pre> <p><strong>./app.js</strong></p> <pre><code class="hljs language-js"><span class="token keyword">export</span> <span class="token keyword">default</span> <span class="token string">\'the app\'</span><span class="token punctuation">;</span></code></pre> <p>通过互相引用，这些模块会形成一个图(<code>ModuleGraph</code>)数据结构。</p> <p>在打包过程中，模块会被合并成 chunk。 chunk 合并成 chunk 组，并形成一个通过模块互相连接的图(<code>ModuleGraph</code>)。 那么如何通过以上来描述一个入口起点：在其内部，会创建一个只有一个 chunk 的 chunk 组。</p> <p><strong>./webpack.config.js</strong></p> <pre><code class="hljs language-js">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  entry<span class="token operator">:</span> <span class="token string">\'index.js\'/*tpa=https://webpack.docschina.org/index.js*/</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre> <p>这会创建出一个名为 <code>main</code> 的 chunk 组（<code>main</code> 是入口起点的默认名称）。 此 chunk 组包含 <code>./index.js</code> 模块。随着 parser 处理 <code>./index.js</code> 内部的 import 时， 新模块就会被添加到此 chunk 中。</p> <p>另外的一个示例：</p> <p><strong>./webpack.config.js</strong></p> <pre><code class="hljs language-js">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  entry<span class="token operator">:</span> <span class="token punctuation">{</span>\n    home<span class="token operator">:</span> <span class="token string">\'home.js\'/*tpa=https://webpack.docschina.org/home.js*/</span><span class="token punctuation">,</span>\n    about<span class="token operator">:</span> <span class="token string">\'about.js\'/*tpa=https://webpack.docschina.org/about.js*/</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre> <p>这会创建出两个名为 <code>home</code> 和 <code>about</code> 的 chunk 组。 每个 chunk 组都有一个包含一个模块的 chunk：<code>./home.js</code> 对应 <code>home</code>，<code>./about.js</code> 对应 <code>about</code></p> <blockquote> <p>一个 chunk 组中可能有多个 chunk。例如，<a href="plugins/split-chunks-plugin/index.htm"/*tpa=https://webpack.docschina.org/plugins/split-chunks-plugin/*/>SplitChunksPlugin</a> 会将一个 chunk 拆分为一个或多个 chunk。</p> </blockquote> <h2 id="chunks">chunk <a href="#chunks" aria-hidden="true" tabindex="-1"><span class="header-link"></span></a></h2> <p>chunk 有两种形式：</p> <ul> <li><code>initial(初始化)</code> 是入口起点的 main chunk。此 chunk 包含为入口起点指定的所有模块及其依赖项。</li> <li><code>non-initial</code> 是可以延迟加载的块。可能会出现在使用 <a href="guides/code-splitting/index.htm#dynamic-imports"/*tpa=https://webpack.docschina.org/guides/code-splitting/#dynamic-imports*/>动态导入(dynamic imports)</a> 或者 <a href="plugins/split-chunks-plugin/index.htm"/*tpa=https://webpack.docschina.org/plugins/split-chunks-plugin/*/>SplitChunksPlugin</a> 时。</li> </ul> <p>每个 chunk 都有对应的 <strong>asset(资源)</strong>。资源，是指输出文件（即打包结果）。</p> <p><strong>webpack.config.js</strong></p> <pre><code class="hljs language-js">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  entry<span class="token operator">:</span> <span class="token string">\'https://webpack.docschina.org/src/index.jsx\'</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre> <p><strong>./src/index.jsx</strong></p> <pre><code class="hljs language-js"><span class="token keyword">import</span> React <span class="token keyword">from</span> <span class="token string">\'react\'</span><span class="token punctuation">;</span>\n<span class="token keyword">import</span> ReactDOM <span class="token keyword">from</span> <span class="token string">\'react-dom\'</span><span class="token punctuation">;</span>\n\n<span class="token keyword">import</span><span class="token punctuation">(</span><span class="token string">\'https://webpack.docschina.org/app.jsx\'</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">then</span><span class="token punctuation">(</span><span class="token parameter">App</span> <span class="token operator">=></span> <span class="token punctuation">{</span>\n  ReactDOM<span class="token punctuation">.</span><span class="token function">render</span><span class="token punctuation">(</span><span class="token operator">&#x3C;</span>App <span class="token operator">/</span><span class="token operator">></span><span class="token punctuation">,</span> root<span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre> <p>这会创建出一个名为 <code>main</code> 的 initial chunk。其中包含：</p> <ul> <li><code>./src/index.jsx</code></li> <li><code>react</code></li> <li><code>react-dom</code></li> </ul> <p>以及除 <code>./app.jsx</code> 外的所有依赖</p> <p>然后会为 <code>./app.jsx</code> 创建 non-initial chunk，这是因为 <code>./app.jsx</code> 是动态导入的。</p> <p><strong>Output:</strong></p> <ul> <li><code>/dist/main.js</code> - 一个 <code>initial</code> chunk</li> <li><code>/dist/394.js</code> - <code>non-initial</code> chunk</li> </ul> <p>默认情况下，这些 <code>non-initial</code> chunk 没有名称，因此会使用唯一 ID 来替代名称。 在使用动态导入时，我们可以通过使用 <a href="api/module-methods/index.htm#magic-comments"/*tpa=https://webpack.docschina.org/api/module-methods/#magic-comments*/>magic comment(魔术注释)</a> 来显式指定 chunk 名称：</p> <pre><code class="hljs language-js"><span class="token keyword">import</span><span class="token punctuation">(</span>\n  <span class="token comment">/* webpackChunkName: "app" */</span>\n  <span class="token string">\'https://webpack.docschina.org/app.jsx\'</span>\n<span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">then</span><span class="token punctuation">(</span><span class="token parameter">App</span> <span class="token operator">=></span> <span class="token punctuation">{</span>\n  ReactDOM<span class="token punctuation">.</span><span class="token function">render</span><span class="token punctuation">(</span><span class="token operator">&#x3C;</span>App <span class="token operator">/</span><span class="token operator">></span><span class="token punctuation">,</span> root<span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre> <p><strong>Output:</strong></p> <ul> <li><code>/dist/main.js</code> - 一个 <code>initial</code> chunk</li> <li><code>/dist/app.js</code> - <code>non-initial</code> chunk</li> </ul> <h2 id="output">output(输出) <a href="#output" aria-hidden="true" tabindex="-1"><span class="header-link"></span></a></h2> <p>输出文件的名称会受配置中的两个字段的影响：</p> <ul> <li><a href="configuration/output/index.htm#outputfilename"/*tpa=https://webpack.docschina.org/configuration/output/#outputfilename*/><code>output.filename</code></a> - 用于 <code>initial</code> chunk 文件</li> <li><a href="configuration/output/index.htm#outputchunkfilename"/*tpa=https://webpack.docschina.org/configuration/output/#outputchunkfilename*/><code>output.chunkFilename</code></a> - 用于 <code>non-initial</code> chunk 文件</li> <li>在某些情况下，使用 <code>initial</code> 和 <code>non-initial</code> 的 chunk 时，可以使用 <code>output.filename</code>。</li> </ul> <p>这些字段中会有一些 <a href="configuration/output/index.htm#template-strings"/*tpa=https://webpack.docschina.org/configuration/output/#template-strings*/>占位符</a>。常用的占位符如下：</p> <ul> <li><code>[id]</code> - chunk id（例如 <code>[id].js</code> -> <code>485.js</code>）</li> <li><code>[name]</code> - chunk name（例如 <code>[name].js</code> -> <code>app.js</code>）。如果 chunk 没有名称，则会使用其 id 作为名称</li> <li><code>[contenthash]</code> - 输出文件内容的 md4-hash（例如 <code>[contenthash].js</code> -> <code>4ea6ff1de66c537eb9b2.js</code>）</li> </ul> '}}]);